    number: '6'
    value: 'The 10/10 $120,000 independent expenditure for Grassroots Campaigns, reported
      on the 10/10 48 Hour notice, was estimated amount of the total invoice.  The
      Pre-General report disclosed $28,125 paid to Grassroots Campaigns to date.  This
      report discloses a secondary payment to Grassroots Campaigns in the amount of
      $42,187.50.    The 10/11 $15,000 000 independent expenditure for the MD League
      of Conservation Voters, reported on the 10/16 48 Hour notice, was estimated
      amount of the total invoice.  This report discloses the final payment to the
      MD League of Conservation Voters in the amount of $10,145.91.      The League
      of Conservation Voters Action Fund Pre-General reported two 48 hours notices
      in support of Frank Kratovil on 10/16: $6,000 to Terris Barnes Walters and $10,145.91
      to the MD League of Conservation Voters.  Both IEs had a 48 hour filing deadline
      of 10/13.  However, due to an administrative error by our compliance vendor,
      the notices were not filed until 10/16.  As soon as we were aware a filing had
      been missed, best efforts were made to disclose these expenditures in a timely
      fashion.'
